import { React, useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const History = () => {
  let { tokenId } = useParams();

  const [transactions, setTransactions] = useState([]);

  useEffect(async () => {
    const response = await axios.get(`http://localhost:8080/getNftHistory`, {
      params: { tokenId: tokenId },
    });

    setTransactions(response.data.result);
  }, []);

  console.log(transactions[0].returnValues);

  return (
    <div className="historySection">
      <table>
        <thead className="tHeader">
          <tr>
            <td className="tableCell">FROM</td>
            <td className="tableCell">TO</td>
            <td className="tableCell">PRICE</td>
            <td className="tableCell">DATE</td>
          </tr>
        </thead>

        {transactions.map(() => {
          return (
            <tbody>
              <tr>

                <td className="tableCell">
                  0xbD9D4a71B76C494958d9DEADD258A1e3d4c08014
                </td>
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">20 TOKENS</td>
                <td className="tableCell">DATE</td>
              </tr>

              <tr>
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">20 TOKENS</td>
                <td className="tableCell">DATE</td>
              </tr>

              <tr>
                {/* <td className="tableCell">Event</td> */}
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">20 TOKENS</td>
                <td className="tableCell">DATE</td>
              </tr>

              <tr>
                {/* <td className="tableCell">Event</td> */}
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">
                  0xbD9D4a71B76C494958d9D258A1e3d4c0801495e0
                </td>
                <td className="tableCell">20 TOKENS</td>
                <td className="tableCell">DATE</td>
              </tr>
            </tbody>
          );
        })}
      </table>
    </div>
  );
};

export default History;
